def list_cameras():
    for camera in cameras["features"]:
        cam = camera["properties"]
        gcam = camera["geometry"]["coordinates"]
        yield {"description": cam["description"], "geo": {"lat": gcam[1], "lon": gcam[0]}, "id": cam["id"], "format": cam["rtsp_url"]}